import "./widgetLg.css";
import axios from "axios";

import { makeStyles } from "@material-ui/core/styles";
import Table from "@material-ui/core/Table";
import TableBody from "@material-ui/core/TableBody";
import td from "@material-ui/core/td";
import TableContainer from "@material-ui/core/TableContainer";
import TableHead from "@material-ui/core/TableHead";
import TableRow from "@material-ui/core/TableRow";
import Paper from "@material-ui/core/Paper";
import react, { useEffect, useState } from "react";
import { Button, ButtonBase, FormLabel, Menu, MenuItem, TextField } from "@material-ui/core";
import { Link } from "react-router-dom/cjs/react-router-dom.min";
export default function WidgetLg() {
  const useStyles = makeStyles({
    btn: {
      backgroundColor: "rgb(228, 228, 250)",
      float: "center",
      margincenter: 50,
    },
    table: {
      minWidth: 650
    }
  });
  const classes = useStyles();
  const [users, setUsers] = useState([]);
  useEffect(() => {
    loadProduct();
  }, []);

  const loadProduct = async () => {
    await axios.get("http://localhost:3003/task").then((res) => {
      setUsers(res.data);
    });
  };
  const Button = ({ type }) => {
    return <button className={"widgetLgButton " + type}>{type}</button>;
  };
  return (
    <div className="widgetLg">
      <h3 className="widgetLgTitle">Latest transactions</h3>
      <table >
            <thead>
              <tr>
                <td align="center">Name</td>
                <td align="center">Time&nbsp;</td>
              </tr>
            </thead>
            <tbody>
              {users.map((row) => (
                <tr key={row.id}>
                  <td align="center">{row.name}</td>
                  <td align="center">{row.time}</td>
                </tr>
              ))}
            </tbody>
          </table>
    </div>
  );
}
